import React from "react";

import Link from "next/link";
import { Route } from "react-router-dom";

const Test = () => {
  return <p>Hello</p>;
};

const Index = () => {
  return (
    <div>
      <Link href="/aa">dd</Link>
      <Route path="aa" component={Test} />
    </div>
  );
};

export default Index;
